import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
//------------------------------------------
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import InputGroup from "react-bootstrap/InputGroup";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

export function Navigation() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand className="h1 text-decoration-none" href="#home">
          style
          {{
            color: "blue",
          }}
          AFRO NATUREL
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mx-auto h4">
            <Nav.Link href="#">CRAZY POUSS - Lotion capillaire</Nav.Link>
            <Nav.Link href="#">CRAZY POUSS - Lotion tonic</Nav.Link>
            <Nav.Link href="#">CRAZY POUSS - Bonnet en wax </Nav.Link>
            <Nav.Link href="#">CRAZY POUSS - SÃ©rum de croissance </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export function Recherche() {
  return (
    <Navbar className="bg-body-tertiary  justify-content-around py-3">
      <Form inline>
        <InputGroup>
          <Button type="submit" variant="info">
            Code Promo
          </Button>
          <Form.Control
            placeholder="saisir votre code"
            aria-label="Username"
            aria-describedby="basic-addon1"
          />
        </InputGroup>
      </Form>
      <Form inline>
        <Row>
          <Col xs="auto">
            <Form.Control
              type="text"
              placeholder="Ecrivez quelque chose"
              className=" mr-sm-2"
            />
          </Col>
          <Col xs="auto">
            <Button type="submit" variant="info">
              Rechercher
            </Button>
          </Col>
        </Row>
      </Form>
    </Navbar>
  );
}
